import React from "react";
import { Container, Row, Col, Nav, Button } from "react-bootstrap";
import "./Header.css";

const Header = () => {
  return (
    <div className="top-header">
      <Container>
        <Row className="align-items-center justify-content-between">
          <Col className="top-links" md="auto">
            <Nav className="flex-row gap-3">
              <Nav.Link href="#">Срочно</Nav.Link>
              <Nav.Link href="#">РУС</Nav.Link>
              <Nav.Link href="#">Вход / Регистрация</Nav.Link>
            </Nav>
          </Col>
          <Col className="text-end" md="auto">
            <Button variant="danger" className="add-button">
              Добавить объявление
            </Button>
          </Col>
        </Row>
      </Container>
    </div>
  );
};
